parts:
{
  "name": "UBX-NAV-TIMEBDS",
  "class_id": "0x01",
  "message_id": "0x24",
  "description": "BeiDou time solution",
  "message_type": "periodic_polled",
  "payload_length": {
    "fixed": 20
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "iTOW",
      "data_type": "U4",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch. See the description of iTOW for details."
    },
    {
      "byte_offset": 4,
      "name": "SOW",
      "data_type": "U4",
      "unit": "s",
      "description": "BDS time of week (rounded to seconds)"
    },
    {
      "byte_offset": 8,
      "name": "fSOW",
      "data_type": "I4",
      "unit": "ns",
      "scale": {
        "raw": "ns",
        "multiplier": 1e-9
      },
      "description": "Fractional part of SOW (range: +/- 500000000). The precise BDS time of week in seconds is: SOW + fSOW * 1e-9"
    },
    {
      "byte_offset": 12,
      "name": "week",
      "data_type": "I2",
      "description": "BDS week number of the navigation epoch"
    },
    {
      "byte_offset": 14,
      "name": "leaps",
      "data_type": "I1",
      "unit": "s",
      "description": "BDS leap seconds (BDS-UTC)"
    },
    {
      "byte_offset": 15,
      "name": "valid",
      "data_type": "X1",
      "description": "Validity Flags",
      "fields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "sowValid",
          "description": "1 = Valid SOW and fSOW (see Time Validity section for details)"
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "weekValid",
          "description": "1 = Valid week (see Time Validity section for details)"
        },
        {
          "bit_offset": 2,
          "bit_length": 1,
          "name": "leapSValid",
          "description": "1 = Valid leap second"
        },
        {
          "bit_offset": 3,
          "bit_length": 5,
          "name": "reserved1",
          "reserved": true
        }
      ]
    },
    {
      "byte_offset": 16,
      "name": "tAcc",
      "data_type": "U4",
      "unit": "ns",
      "scale": {
        "raw": "ns",
        "multiplier": 1e-9
      },
      "description": "Time Accuracy Estimate"
    }
  ]
}
